// Robust phone normalization + matching for n8n Code node

// ----- Normalizer -----
const normalizePhoneNumber = (phone) => {
  if (!phone && phone !== 0) return '';
  // keep only digits
  let s = String(phone).replace(/\D/g, '');

  // Remove leading zeros
  while (s.length > 10 && s.startsWith('0')) {
    s = s.slice(1);
  }

  // Remove leading country code '91' (common for India)
  if (s.length > 10 && s.startsWith('91')) {
    s = s.slice(2);
  }

  // Final safety: return last 10 digits
  return s.slice(-10);
};

// ----- Helpers to find salestrail mock/data -----
const allInputs = $input.all();

const tryNodeJson = (nodeName) => {
  try {
    const n = $(nodeName);
    if (n && n.first && n.first().json) return n.first().json;
  } catch (e) {}
  return null;
};

let salestrailItemWrapper = allInputs.find(it => it.json && (
  it.json.number || it.json.formattedNumber || it.json.recUrl || it.json.callId || it.json.phone
));

if (!salestrailItemWrapper) {
  const fallback = tryNodeJson('Edit Fields') || tryNodeJson('Get Salestrail Call Data');
  if (fallback) salestrailItemWrapper = { json: fallback };
}

if (!salestrailItemWrapper) salestrailItemWrapper = { json: $json };

const salesJson = salestrailItemWrapper.json || {};
const rawSalesNumber = salesJson.number || salesJson.formattedNumber || salesJson.phone || '';
const normalizedSales = normalizePhoneNumber(rawSalesNumber);

// --- NEW: derive zoho_call_type ---
let zohoCallType = "Outbound"; // default
if (salesJson.inbound === true || salesJson.inbound === "true") {
  zohoCallType = (salesJson.answered === true || salesJson.answered === "true") ? "Inbound" : "Missed";
} else if (salesJson.inbound === false || salesJson.inbound === "false") {
  zohoCallType = (salesJson.answered === true || salesJson.answered === "true") ? "Outbound" : "Missed";
}
salesJson.zoho_call_type = zohoCallType;

// Collect Zoho-contact-like items
const zohoItems = allInputs.filter(it => it.json && (it.json.Phone || it.json.phone || it.json.id));

let matched = null;
for (const it of zohoItems) {
  const z = it.json;
  const rawZoho = z.Phone || z.phone || '';
  const normalizedZoho = normalizePhoneNumber(rawZoho);

  if (normalizedZoho && normalizedZoho === normalizedSales) {
    const matchedJson = Object.assign({}, z);
    matchedJson.isExistingContact = true;
    matchedJson.Who_Id = z.id || z.ID || z.Id;
    matchedJson.contactName = z.Full_Name || z.full_name || z.Name || matchedJson.contactName;
    matchedJson.salestrailData = salesJson;
    matchedJson.formattedNumber = normalizedSales;
    matchedJson.zoho_call_type = zohoCallType;   // ✅ also add here
    matched = { json: matchedJson };
    break;
  }
}

if (matched) {
  return [matched];
} else {
  const out = Object.assign({}, salesJson);
  out.isExistingContact = false;
  out.formattedNumber = normalizedSales;
  out.salestrailData = salesJson;
  out.zoho_call_type = zohoCallType;   // ✅ make sure lead path also has it
  return [{ json: out }];
}

