// Get binary data from Download Recording node
const binaryData = $input.item.binary.data;
const fileName = binaryData.fileName || 'recording.m4a';

// Get Lead ID from Create Lead Record response
const leadId = $('Create Lead Record').item.json.data[0].details.id;

// Get additional info from If1 node
const phoneNumber = $('If1').item.json.formattedNumber;
const leadName = `Lead - ${phoneNumber}`;

console.log("Lead ID found:", leadId);
console.log("Phone Number:", phoneNumber);
console.log("File Name:", fileName);

return {
  json: {
    leadId: leadId,
    phoneNumber: phoneNumber,
    leadName: leadName,
    fileName: fileName
  },
  binary: {
    data: binaryData
  }
};

// Get current time
const now = new Date();

// Go back 6 minutes (buffer to avoid missing delayed calls)
const fromTime = new Date(now.getTime() - 6 * 60 * 1000);

// Format to ISO
const fromDate = fromTime.toISOString();
const toDate = now.toISOString();

return {
  json: {
    fromDate: fromDate,
    toDate: toDate
  }
};
